import React from "react";
import './UserList.module.css'

function UserList(props){
    return (
        <Card className = {classes.users}>
        <ul>
            {
                props.users.map((user)=>{
                    return <li>
                        {user.name}({user.age} year old)
                    </li>
                })
            }
        </ul>
        </Card>
    )

}

export default UserList
